import moment from 'moment';
import { UncontrolledTooltip } from 'reactstrap';

import React, { useState } from 'react';
import { Tooltip } from 'reactstrap';
export default function RenderAllocationAndReturnsListTable(props) {
  let response = [];
  // const [tooltipOpen, setTooltipOpen] = useState(false);
  // const toggle = () => setTooltipOpen(!tooltipOpen);
  if (props.data.length <= 0) {
    response.push(
      <tr key="1">
        <td colSpan="12">No Data</td>
      </tr>
    )
  } else {
    response = props.data.map((row, index) => (
      <tr key={index}>
        <td>{index + 1}</td>
        <td>{row.fileName}</td>
        <td>{moment(row.date, 'YYYY-MM-DD h:mm:ss').format('DD-MM-YYYY h:mm a')}</td>
        <td>{row.fileType}</td>
        <td>{row.totalRecords}</td>
        <td>{(row.status == 'SUCCESS') ? (<span className="text-success">{row.status}</span>) : (<span className="text-danger">{row.status}</span>)}</td>
/
        {/* <td>
          <button
            className={(row.status == 'SUCCESS') ? "btn-action btn-action-desabled" : "cursor-pointer btn-action btn-action-active"}
          >
            <i className="fa fa-repeat" aria-hidden="true" id="DisabledAutoHideExample">
            </i>
            <UncontrolledTooltip placement="right" target="UncontrolledTooltipExample">
              Hello world!
            </UncontrolledTooltip>
          </button>

        </td> */}

      </tr>
    ))
  }
  return (
    response
  )
}
